import React, { Component } from 'react'
import client from '../../../../../portofolio/portfolio/src/client'
import { Navbar } from '../../component/major/Navbar'

import Tutorial from './Tutorial'

export default class TutorialData extends Component {
    constructor() {
        super()
    
        this.state = {
            articles: []
        }
    }
    
    componentDidMount() {
        client.getEntries({content_type: 'tutorial'}).then((response) => {
            this.setState({articles: response.items})
            console.log(response.items)
        })
    } 
    
    render() {
        const articles = this.state.articles.map((article, i) => <Tutorial id={i} key={i} article={article}/>)
        if(!articles){
            return <p>Loading</p>
        }
        return (
            <div>
                <Navbar/>
                <div>
                    {articles}
                </div>
            </div>
        )
    }
}
